!! instance, jt = 1 refers to a temperature of 188.0, jt = 2 refers
!! to 195.2, etc. the third index runs over the g-channel (1 to NG03=16).
      real (kind=kind_phys), public :: kb_mn2o(NG03,MBF03,MMN03)

